import React from "react";
import PropTypes from "prop-types";

Edit.propTypes = {};

function Edit(props) {
  return (
    <div>
      <p>What need to be poll ? </p>
      <div>
        <input placeholder="Add option"></input>
        <button>Add</button>
        <div></div>
      </div>
    </div>
  );
}

export default Edit;
